class SurveyCategoryIcon: UIView {
    enum CategoryID: Int {
        case Video = 73
        case Male = 82
//        case MenOther = 39
        case Female = 86
        case Car = 52
        case Education = 61
        case Gadgets = 47
        case Null  = 0
    }
    
    var categoryID: CategoryID = .Null {
        didSet {
            if categoryID != oldValue {
                setNeedsDisplay()
            }
        }
    }
    
    var tagColor: UIColor?
//    var ID: Int { get }
//    init()
    
    override func draw(_ rect: CGRect) {
        switch categoryID {
        case .Video:
            CategoryIconsStyleKit.drawVideo(frame: rect, resizing: .aspectFit, outerColor: tagColor)
        case .Male:
            CategoryIconsStyleKit.drawWomanHead(frame: rect, resizing: .aspectFit, outerColor: tagColor)
        case .Female:
            CategoryIconsStyleKit.drawWomanHead(frame: rect, resizing: .aspectFit, outerColor: tagColor)
        case .Car:
            CategoryIconsStyleKit.drawCar(frame: rect, resizing: .aspectFit, outerColor: tagColor)
        case .Education:
            CategoryIconsStyleKit.drawEducation(frame: rect, resizing: .aspectFit, outerColor: tagColor)
        case .Gadgets:
            CategoryIconsStyleKit.drawGadgets_2(frame: rect, resizing: .aspectFit, outerColor: tagColor)
        default:
            super.draw(rect)
        }

    }
}

